import React , { Component } from 'react'

export class SignIn extends Component {
  
  constructor( props ){
    super(props)

    this.state = {}
  }
  
  render(){
    return(
      <div>
        <form autoComplete={ false } >
          <p>
            <label> Email:</label>
            <input placeholder='Email address' name='email'/>
          </p>
          <p>
            <label> Email:</label>
            <input placeholder='Email address' name='email'/>
          </p>
          <button type='logIn' >Log In</button>
          <button type='signUp' >Sign Up</button>
        </form>
      </div>
    )
  }
}
